import React from 'react'
import jeremy from "../../assets/images/image-jeremy.png"
import work from "../../assets/images/icon-work.svg"
import play from "../../assets/images/icon-play.svg"
import study from "../../assets/images/icon-study.svg"
import exercise from "../../assets/images/icon-exercise.svg"
import social from "../../assets/images/icon-social.svg"
import self from "../../assets/images/icon-self-care.svg"
import styled from 'styled-components'

export default function Desktop() {
    const data = [
        {
          "img": "jeremy",
          "title": "Work",
          "timeframes": {
            "daily": {
              "current": 5,
              "previous": 7
            },
            "weekly": {
              "current": 32,
              "previous": 36
            },
            "monthly": {
              "current": 103,
              "previous": 128
            }
          }
        },
        {
          "title": "Play",
          "timeframes": {
            "daily": {
              "current": 1,
              "previous": 2
            },
            "weekly": {
              "current": 10,
              "previous": 8
            },
            "monthly": {
              "current": 23,
              "previous": 29
            }
          }
        },
        {
          "title": "Study",
          "timeframes": {
            "daily": {
              "current": 0,
              "previous": 1
            },
            "weekly": {
              "current": 4,
              "previous": 7
            },
            "monthly": {
              "current": 13,
              "previous": 19
            }
          }
        },
        {
          "title": "Exercise",
          "timeframes": {
            "daily": {
              "current": 1,
              "previous": 1
            },
            "weekly": {
              "current": 4,
              "previous": 5
            },
            "monthly": {
              "current": 11,
              "previous": 18
            }
          }
        },
        {
          "title": "Social",
          "timeframes": {
            "daily": {
              "current": 1,
              "previous": 3
            },
            "weekly": {
              "current": 5,
              "previous": 10
            },
            "monthly": {
              "current": 21,
              "previous": 23
            }
          }
        },
        {
          "title": "Self Care",
          "timeframes": {
            "daily": {
              "current": 0,
              "previous": 1
            },
            "weekly": {
              "current": 2,
              "previous": 2
            },
            "monthly": {
              "current": 7,
              "previous": 11
            }
          }
        }
      ]
  return (
    <SectionWrapper>
        <DesktopSection>
            <Left>
                <ProfileDiv>
                    <RoundImg><Logo src={jeremy} alt="Image" /></RoundImg>
                    <Report>Report for</Report>
                    <ProfileName>Jeremy Robson</ProfileName>
                </ProfileDiv>
                <ProfileP>Daily</ProfileP>
                <ProfileP>Weekly</ProfileP>
                <ProfileP>Monthly</ProfileP>
            </Left>
            <Right>
                <Parent>
                    <Chaild>
                        <IconImage><Img src={work} alt="Image" /></IconImage>
                        <DiV>
                            <Title>work</Title>
                            <Time>32hrs</Time>
                            <LastWeak>Last Week - 36hrs</LastWeak>
                        </DiV>
                    </Chaild>
                </Parent>
            </Right>
        </DesktopSection>
    </SectionWrapper>
  )
}

const SectionWrapper = styled.wrapper``;
